import Drawer from "rc-drawer";
import React from "react";

function MainDrawer({
    children,
    drawerOpen,
    closeDrawer
}) {
    return ( <
        Drawer open = {
            drawerOpen
        }
        onClose = {
            closeDrawer
        }
        handler = {
            false
        }
        level = {
            null
        }
        placement = "right" >
        {
            children
        } <
        /Drawer>
    );
}

export default MainDrawer;
